I don’t dislike a lot of things but I REALLY DISLIKE dental bills and cavities. We had the opportunity to try out these neat toothbrushes from Evowera. They track the girls’ efficiency, the areas they missed, the amount of times they brush and for how long, all accessible through an app. There’s a little bit of a learning curve and they don’t vibrate but I can send little positive messages to their toothbrushes that they can read after they finish brushing. I’ll never have to doubt whether or not the girls have actually brushed ever again!

